import Portfolio from './components/portfolio.js';
import './components/header.js';

function App() {
  return (
    <div className="App">
      <NavigationBar  />
      <Hero  />
      <About  />
      <CareerEdu />
      <Portfolio />
    </div>
  );
}

export default App;
